import _ from 'underscore';

var image_base64 = '';

var appendScreenshotAfterExecution = function (cell) {
  /**
   * This is responsible for taking a notebook cell object and altering the
   * append_output function to add a hidden screenshot of the map to the
   * cell representation. This will cause the screenshot to be saved within
   * the JSON representation (.ipynb file) of the notebook and be displayed
   * in exported formats (such as static HTML).
   *
   * Additionally it's responsible for unhiding any PNGs being displayed by the user
   * that aren't created from Geonotebook screenshots. This is necessary because
   * Geonotebook hides ALL PNGs by default with CSS to avoid users seeing screen
   * captures for a brief moment when the notebook loads.
   **/
  cell.output_area.append_output = _.wrap(
    cell.output_area.append_output, function (append_output, json) {
      append_output.call(this, json);

      // If the output that was just appended was a png and wasn't one of ours
      // we need to display it.
      if (json.output_type === 'display_data' && _.has(json.data, 'image/png') &&
          !(_.has(json.metadata, 'geonotebook_hidden') && json.metadata.geonotebook_hidden)) {
        $(this.element.children('.output_area')).find('.output_png').css('display', 'block');
      }

      // If this is an execution result (i.e. python code that does more than just print), then
      // take a screenshot of the map and append it to the cell's output.
      if (json.output_type === 'execute_result') {
        cell.output_area.append_output({
          output_type: 'display_data',
          data: {
            'image/png': image_base64
          },
          metadata: {
            'geonotebook_hidden': true
          }
        });
      }
    });
};

function provenance_load (Jupyter, events) {
  /**
   * This is responsible for:
   * 1) restoring the display of any PNGs which aren't Geonotebook screenshots
   *    (see appendScreenshotAfterExecution docs).
   * 2) overriding existing code cells output generation to enable capturing of screenshots
   *    and applying the same logic to newly created code cells.
   **/
  var codeCells = _.filter(Jupyter.notebook.get_cells(), _.matcher({cell_type: 'code'}));

  // Restore existing PNGs which aren't geonotebook screenshots
  _.each(codeCells, function (cell) {
    var outputElements = cell.output_area.element.children('.output_area');

    _.each(cell.output_area.outputs, function (output, i) {
      if (!_.has(output, 'metadata') || !_.has(output.metadata, 'geonotebook_hidden') ||
          !output.metadata.geonotebook_hidden) {
        $(outputElements[i]).children('.output_png').css('display', 'block');
      }
    });
  });

  // Modify existing cell objects to append screenshots
  _.map(codeCells, appendScreenshotAfterExecution);

  // Append screenshots on all future cells that are created
  events.on('create.Cell', function (e, data) {
    if (data.cell.cell_type === 'code') {
      appendScreenshotAfterExecution(data.cell);
    }
  });
}

export default provenance_load;
